import React, { useEffect } from 'react'
import { ToastContainer, toast } from 'react-toastify';
import {
    MDBCol, MDBRow
} from 'mdb-react-ui-kit';


import Card from '../../components/Card';

import '../../styles/broker/main.css';
import { get, post, patch, remove } from '../../Api';


const BrokerDashboard = () => {
    const [loading, setLoading] = React.useState(true);
    const [productData, setProductData] = React.useState([]);

    const getProductData = async () => {
        try {
            setLoading(true)
            const response = await get('api/product/getAll');
            if (response.status === 200) {
                setLoading(false);
                setProductData(response.data.data);
            }
        }
        catch (error) {
            if (error.response && error.response.status === 400) {
                toast.error(error.response.data.error)
            }
            else {
                toast.error(error.message)
            }
            setLoading(false);
        }
    }

    useEffect(() => {
        getProductData();
    }, []);
    return (
        <div className='custom-margin-top'>
            <MDBRow className='row-cols-3 row-cols-md-2 g-4'>
                {
                    (productData && productData.length > 0) && productData.map((item, index) => {
                        return (

                            <MDBCol>
                                <Card key={index} data={item} />
                            </MDBCol>

                        )
                    })
                }
            </MDBRow>
        </div>
    )
}

export default BrokerDashboard
